import React from 'react';
import { View, TouchableOpacity, Text } from 'react-native';
import StyleButtonList from './StyleButtonLIst';
import SavedmessagePage from '../../../../SavedMessagePage/SavedMessagePage';
import { createStackNavigator, StackNavigationProp } from '@react-navigation/stack';
import { NavigationContainer, RouteProp } from '@react-navigation/native';
const Stack = createStackNavigator();
type RootStackParamList = {
  Home: undefined;
  SavedMessage: undefined;
  Look: undefined;
  Notification: undefined;
  ChatFolders: undefined;
  Confidentiality: undefined;
  Language: undefined;
};
type ButtonListScreenNavigationProp = StackNavigationProp<RootStackParamList, 'Home'>;


const ButtonList = ({navigation}:{navigation:ButtonListScreenNavigationProp}) => {
    let items: string[] =["Saved message","Look","Notification","Chat folders","Confidentiality","Language",];
    return <View>
    {items.map((item, index) => (
      <View key={index} >
        <TouchableOpacity style={StyleButtonList.button} onPress={() => navigation.navigate('Saved message')}>
          <Text>{item}</Text>
        </TouchableOpacity>
      </View>
    ))}
  </View>
}

export default ButtonList;
